import breakingBad from '../data/breakingBad.jpeg';

const Welcome = () => {
  return (
    <div>
      <h1>Welcome To Breaking Bad</h1>;
      <img src={breakingBad} alt="image" />
    </div>
  );
};

export default Welcome;
